    description: >-
      <body>




      <p>
      	Documentación en Español incluida en la descarga.
      </p>


      <p>
      	<strong>Description</strong><br>
      	This is a pack of japanese “<abbr title="Wall-to-Wall">w2w</abbr>” growable lots for your dense urban environments, their style makes them look great in any kind of city, not just asian ones. I’ve taken these building models, given them new stats, put them in lots and even combined some of them together to achieve that dense, built-up look of a modern downtown.
      </p>


      <p>
      	<strong>Installation</strong><br>
      	Just unzip the folder with the lot files anywhere in your Plugins directory. It's recommended to keep the folder structure intact to help maintain your content organized.<br>
      	Don't extract the Documentation files to your Plugins folder!
      </p>


      <p>
      	<strong>Uninstallation</strong><br>
      	Make sure you bulldoze every instance of these buildings you may have in your cities. After that, remove the files from your Plugins folder.
      </p>


      <p>
      	<strong>Dependencies</strong><br>
      	Make sure you have all the files in your Plugins, if you don't, you will get brown boxes instead of the actual buildings and some textures could also be missing.<br>
      	-<a href="https://community.simtropolis.com/files/file/26808-vip-girafe-vnaoned-carpack-vol01-vol02-v2/" rel="">girafe carpack 1 &amp; 2</a><br>
      	-rush_zakkyo_1-10<br>
      	-rush_zakkyo_11-20<br>
      	-rush_zakkyo_20-26<br>
      	Download from <a href="http://sim4rush.tuzikaze.com/sc4/bat.html" rel="external nofollow">here</a>, scroll down until you see the following, then click the links shown below:
      </p>


      <p>
      	<img alt="66bec1be7bfe6_Rushzakkyo.jpg.ee21ca238535a557d424456cb85de1a4.jpg" class="ipsImage ipsImage_thumbnailed ipsAttachLink_image ipsAttachLink_left" data-fileid="104966" src="https://www.simtropolis.com/objects/attachments/monthly_2024_08/66bec1be7bfe6_Rushzakkyo.jpg.ee21ca238535a557d424456cb85de1a4.jpg" style="width:920px;height:auto;float:left;" >
      </p>


