      <p>
      	<strong>Notes</strong><br>
      	I did not make the model(s) and do not claim any credit for them. The modding of this buildings was made using the <abbr title="Plugin Manager">PIM</abbr>-X tool, so there shouldn't be any problem with these buildings throwing the game off balance.<br>
      	If you run into any issues, or want to see other things I'm working on, pay a visit to my lot thread in Simtropolis, you can also PM me here.
      </p>


      <p>
      	Enjoy!
      </p>

